import React, { useEffect, useState } from "react";

import './homeLanding.css';

import forestImage from '../../assets/images/forest.png';
import skiliftImage from '../../assets/images/skilift.jpg';
import fireworksImage from '../../assets/images/fireworks.jpg';
import skiingImage from '../../assets/images/skiing.png';
import lakeFunImage from '../../assets/images/lake_fun.png';

const homeImages = [
    {
        src: forestImage,
        alt: 'forest'
    },
    {
        src: skiliftImage,
        alt: 'skilift'
    },
    {
        src: fireworksImage,
        alt: 'fireworks'
    },
    {
        src: skiingImage,
        alt: 'skiing'
    },
    {
        src: lakeFunImage,
        alt: 'lake_fun'
    }
];

function HomeLanding() {
    const [imageIndex, setImageIndex] = useState(0);
    
    useEffect(() => {
        setTimeout(() => {

        }, 5000);
    }, [imageIndex]);

    return(
        <div id='landing'>
            <div id='imageContainer'>
                {
                    homeImages.map((img, index) => {
                        return (
                            index === 0 
                                ? <img className='homeImage active' src={img.src} alt={img.alt} />
                                : <img className='homeImage' src={img.src} alt={img.alt} />
                        )
                    })
                }
            </div>
        </div>
    )
}

export default HomeLanding;
